import React from 'react';
import "./App.css"
import Sidebar from "./componets/Sidebar";
import Home from "./componets/Home";
import Search from "./componets/Search";

const App = () => {
    return (
        <div className="main-container">
            <Search/>
            <Sidebar/>
            <Home/>
        </div>
    );
}

export default App;
